function extractUTMs(url) {
  const utmMapping = {
    UTMSOURCEIP3: "utm_source",
    UTMCAMPAIGNIP3: "utm_campaign",
    UTMMEDIUMIP3: "utm_medium",
    UTMTERMIP3: "utm_term",
    UTMCONTENTIP3: "utm_content",
  };

  const utms = {};

  // Extrai a parte de parâmetros da URL
  const queryString = url.split('?')[1];
  if (!queryString) {
    return "vazio";
  }

  // Divide os parâmetros e os processa
  const params = queryString.split('&');
  for (const param of params) {
    const [key, value] = param.split('=');
    const decodedValue = decodeURIComponent(value);

    // Verifica se o parâmetro está no formato personalizado ou no formato original
    if (utmMapping[key]) {
      utms[utmMapping[key]] = decodedValue;
    } else if (Object.values(utmMapping).includes(key)) {
      utms[key] = decodedValue;
    }
  }

  // Retorna "vazio" se nenhuma UTM foi encontrada
  return Object.keys(utms).length > 0 ? utms : "vazio";
}

